package Iniciante;

import java.util.Scanner;

public class I_1004_ProdutoSimples {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a;
		int b;
		int prod;
		
		Scanner sc = new Scanner(System.in);
		a = sc.nextInt();
		b = sc.nextInt();
		prod = a * b;
		
		System.out.println("PROD = "+prod);

	}

}
